import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('input.search-input'); // Wait for the search input to be visible
    await page.fill('input.search-input', 'tutorial'); // Type "tutorial" in the search input

    // Click the search button
    await page.waitForSelector('button.search-btn'); // Ensure the search button is available
    await page.click('button.search-btn'); // Click the search button

    // Wait for the results page to load and display videos
    await page.waitForSelector('.video-grid'); // Wait for the video grid to be visible

    // Take a screenshot of the search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Verify that the video grid contains videos
    const videoCount = await page.evaluate(() => {
      return document.querySelectorAll('.video-grid .video-item').length; // Adjust selector based on actual structure
    });

    return {
      success: true,
      action: "Searched for 'tutorial' and verified the search results page loaded with videos.",
      extractedData: { videoCount },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
